CREATE TABLE dbo.rate(
	RateId VARCHAR(60) PRIMARY KEY NOT NULL,
	RateName VARCHAR(4000) NULL,
	ShortRateName VARCHAR(4000) NULL,
	SettlementAction tinyint NULL,
	SettlementTrigger tinyint NULL,
	SettlementValue decimal(18, 9) NULL,
	SettlementType tinyint NULL
);

CREATE TABLE dbo.reservation(
	StartUtc datetime(6) NULL,
	EndUtc datetime(6) NULL,
	CreatedUtc datetime(6) NULL,
	NightCount int NULL,
	NightCost_Sum decimal(38, 12) NULL,
	OccupiedSpace_Sum int NOT NULL,
	GuestCount_Sum int NULL,
	LeadTime int NULL,
	StayLength int NULL,
	CancellationReason int NULL,
	SettlementType int NULL,
	ReservationState int NULL,
	Origin int NULL,
	CommanderOrigin int NULL,
	TravelAgency nvarchar(255) NULL,
	IsOnlineCheckin int NULL,
	NationalityCode nvarchar(50) NULL,
	Gender int NULL,
	Classification int NULL,
	AgeGroup int NOT NULL,
	HasEmail int NULL,
	EnterpriseTimeZone int NULL,
	BusinessSegment nvarchar(255) NULL,
	Tier tinyint NULL,
	RateId VARCHAR(60) NOT NULL
);

      
